  constructor() { }
  getAllFoodByTag(tag: string): Foods[] {
    if (tag === 'all') // You might want to make this case-insensitive as well
        return this.getAll();
    else
        return this.getAll().filter(food => food.tags?.some(food => food.toLowerCase() === tag));
}

getFoodById(id:number):Foods{
  return this.getAll().find(food=>food.id==id)!;
}

